import ReactDom from "react-dom/client";
import './style.css'

const root = ReactDom.createRoot(document.getElementById("root"))

function MovieCards({ name, url, category, duration }) {
    return (
        <div>
            <div className="card">
                <img src="{url}" className="poster" alt="poster" />
                <h3>{name}</h3>
                <h4>category: {category}</h4>
            </div>
        </div>
    )
}
root.render(<>
    <MovieCards name="John Wick" category="Action" url="https://m.media-amazon.com/images/S/pv-target-images/6c2c7ace999b2efa7d6d113f7f3ec49f83722dbd2a22b202ef8028f26a1d0b69.jpg" duration=" 1h 41m" />
